import React, { Component } from 'react'
import {NavLink} from 'react-router-dom'

export default class MyNavLink extends Component {
    render() {
        let {to} = this.props;

        return (
            <div>
                <NavLink activeClassName="active" className="list-group-item" to={to}>{to}</NavLink>
            </div>
        )
    }
}
